import React from "react";

const Todo = ({ todo, index, completeTodo }) => {
  return (
    <div className="todo">
      <button onClick={() => completeTodo(index)}></button>
      <p
        className="todo-txt"
        style={{ textDecoration: todo.isCompleted ? "line-through" : "" }}
      >
        {todo.text}
      </p>
    </div>
  );
};

export default Todo;
